const Somos = (props)=>{
    return(
        <main class="holder">
        <div class="somosimg">
            <img src="img/child.jpg" alt="kids"/>
        </div>
        <div class="columnas">
        <div class="somos">
            <h2>QUIENES SOMOS</h2>
            <p>¡Bienvenidos a GREENFIELDS! Somos un rincón de alegría y estilo en el mundo de la moda infantil en línea. Nuestra misión es vestir a los más pequeños con prendas que no solo sean adorables y coloridas, sino también cómodas y duraderas. Entendemos que cada niño es una historia única llena de diversión y travesuras, y eso se refleja en nuestra selección de ropa. Desde los primeros pasos hasta los juegos en el patio trasero, nuestras colecciones están diseñadas para acompañar a los niños en cada aventura. Nos enorgullecemos de ofrecer una amplia gama de estilos que se adaptan a las personalidades en crecimiento, desde los más juguetones hasta los más soñadores. Con una atención meticulosa a la calidad y el detalle, estamos comprometidos en ser el destino favorito de los padres que buscan lo mejor para sus hijos. Únete a nosotros mientras vestimos sonrisas y creamos recuerdos a través de la moda.</p>
        </div>
        </div>
    </main>
    )
}
export default Somos;
